	name: 'Dodgers',
	city: 'Los Angeles'
}

const teamList = [
	{
    name: 'Dodgers',
    city: 'Los Angeles',
    image: "data:image/jpeg;base64,"
  },
  {
    name: 'Yankees',
    city: 'NYC',
    image:'https://a3.espncdn.com/combiner/i?img=%2Fi%2Fteamlogos%2Fmlb%2F500%2Fnyy.png'
  },
  {
    name: 'Mets',
    city: 'NYC',
    image: 'https://upload.wikimedia.org/wikipedia/en/thumb/7/7b/New_York_Mets.svg/1200px-New_York_Mets.svg.png'
  },
  {
    name: 'Rockies ',
    city: 'Denver'
  },
  {
    name: 'Red Sox',
    city: 'Boston'
  },
  {
    name: 'Astros',
    city: 'Houston'
  },
  {
    name: 'Astros',
    city: 'Houston'
  },

]

const displayTeamList = teamList.map((c, idx) => {
	return(
      <div title="image55" >
          <div>
            <div id="child">
              <div>
                <figure>
                  <img 
                    src="https://picsum.photos/300/300/?random"
                    alt="Description"
                  />
                </figure>
              </div>
              <div>
                <h1>
                  <h1 key={idx}>{c.name} {c.city}</h1>
                  </h1>
                <h2>

                   </h2>
                <br />
                <p className="has-text-centered">
                  <a className="button is-medium is-info is-outlined">

                  </a>
                </p>
              </div>
            </div>
          </div>
        </div>
			)
		})


class Cover extends Component {
  render() {
    return (
      <section className="hero is-fullheight is-default is-bold">
        <div id="container">
        {displayTeamList}
        </div> 
      </section>
    );
  }
}

export default Cover;
